import { configureStore } from '@reduxjs/toolkit';
import appReducer from './features/app';
import loginUserReducer from './features/loginUser'

export default configureStore({
    reducer: {
        app: appReducer,
    },
    reducer:{
        loginUser: loginUserReducer,
    }
});
